import React from "react";
import { UserContext } from "../../App";

function F() {
  return (
    <div>
      <UserContext.Consumer>
        User name:
        { user => {
          return <span>{user.username}</span>;
        }}
      </UserContext.Consumer>
    </div>
  );
}

export default F;
